import logo from './logo.svg';
import './App.css';


const App = () => {
  const {count, setCount} = useState(100);

  const increment = () => {
    setCount(count + 1);
  };

  return (
   <div>
     <h2>counter app</h2>
     <button onClick ={increment}>Click {count} times</button>
   </div>
  );

};

